"""#PREPROCESAMIENTO DE LOS DATOS Y ANALISIS EDA

Con los datos ya disponibles se pasa a procesar las imagenes para poder trabajar con ellas.

Se define la función **load_images_from_directory_with_filenames**:
- Lee las imagenes es escala de grises (*Usar imágenes en escala de grises puede ayudar a mejorar la precisión y la velocidad del modelo al enfocarse en la estructura y las texturas esenciales de la imagen*)
-Redimensiona la imagen cargada (***image***) al tamaño especificado por ***target_size*** (150x150 píxeles en este caso). Esto sirve para que el modelo pueda procesar las imágenes de manera uniforme y eficiente.

-  **resized_arr** (la imagen redimensionada) se agrega a la lista **data**.
- **class_num** (la etiqueta de la categoría: 0 para NORMAL, 1 para PNEUMONIA) se agrega a la lista labels.
- **img_path** (la ruta del archivo de la imagen) se agrega a la lista filenames. (Esto será util más adelante)
- Se normaliza las imágenes dividiendo los valores de píxel por 255.0 para que estén en el rango [0, 1], esto ayuda a mejorar la estabilidad y el rendimiento del entrenamiento del modelo.

En resumen, se cambia a escala de grises las imagenes, se normalizan las imagenes y se separa cada grupo de datos en su variable X (imagen) e Y (etiqueta), y se genera una lista de las direcciones (ubicación) de los archivos.
"""

def load_images_from_directory_with_filenames(directory, target_size=(150, 150)):
    categories = ['NORMAL', 'PNEUMONIA']
    data = []
    labels = []
    filenames = []

    for category in categories:
        path = os.path.join(directory, category)
        class_num = categories.index(category)
        for img in os.listdir(path):
            try:
                img_path = os.path.join(path, img)
                image = cv2.imread(img_path, cv2.IMREAD_GRAYSCALE)
                resized_arr = cv2.resize(image, target_size)
                data.append(resized_arr)
                labels.append(class_num)
                filenames.append(img_path)
            except Exception as e:
                print(f"Error loading image {img_path}: {e}")

    data = np.array(data, dtype='float32') / 255.0  # Normalizar aquí
    labels = np.array(labels)
    return data, labels, filenames

