"""![image.png](data:image/png;base64,)

Los datos se ven claramente desbalanceados, por lo que se determina realizar una reducción y balanceo de las datos con la función **reduce_and_balance**, quedando de la siguiente forma:

- TRAIN: 1400 imagenes.
  - NORMAL : 700 imagenes.
  - PNEUMONIA : 700 imagenes.
- TEST : 400 imagenes.
  - NORMAL : 200 imagenes.
  - PNEUMONIA : 200 imagenes.
Los datos de validación se mantienen por que ya estan balanceados:
- VAL : 16 imagenes.
  - NORMAL : 8 imagenes.
  - PNEUMONIA : 8 imagenes.

La reducción de la base de datos se debe a la capacidad computacional reducida con la que se esta trabajando, permitiendo reducir la carga.
"""

def reduce_and_balance(X, Y, samples_per_class):
    X_balanced = []
    Y_balanced = []
    for class_label in np.unique(np.argmax(Y, axis=1)):
        X_class = X[np.argmax(Y, axis=1) == class_label]
        Y_class = Y[np.argmax(Y, axis=1) == class_label]
        X_class_resampled, Y_class_resampled = resample(X_class, Y_class, n_samples=samples_per_class, random_state=SEED)
        X_balanced.extend(X_class_resampled)
        Y_balanced.extend(Y_class_resampled)
    return np.array(X_balanced), np.array(Y_balanced)

X_train_bal, Y_train_bal = reduce_and_balance(X_train, Y_train, samples_per_class=700)  # Total 1400
X_val_bal, Y_val_bal = X_val, Y_val  # Mantener los 16 datos de validación
X_test_bal, Y_test_bal = reduce_and_balance(X_test, Y_test, samples_per_class=200)  # Total 400

"""Se grafican para verificar que se balancearon"""

