"""![image.png](data:image/png;base64,)

El entrenamiento se detuvo a las 52 epocas.

**Precisión de Entrenamiento vs Validación:** La precisión de validación muestra fluctuaciones, lo que puede indicar variabilidad en la precisión durante las épocas.

**Pérdida de Entrenamiento vs Validación:** La pérdida de validación es algo volátil, sugiriendo posibles mejoras necesarias en la estabilidad del modelo.
"""

def evaluate_model_manual(model, X_test, Y_test, model_name):
    Y_pred = np.argmax(model.predict(X_test), axis=1)
    Y_true = np.argmax(Y_test, axis=1)

    print(f"Informe de clasificación para el modelo {model_name}:\n")
    print(classification_report(Y_true, Y_pred, target_names=['NORMAL', 'PNEUMONIA']))

    cm = confusion_matrix(Y_true, Y_pred)
    print(cm)

    plt.figure(figsize=(8, 6))
    plt.imshow(cm, interpolation='nearest', cmap='Blues')
    plt.title(f'Matriz de Confusión para el modelo {model_name}')
    plt.colorbar()
    tick_marks = np.arange(len(['NORMAL', 'PNEUMONIA']))
    plt.xticks(tick_marks, ['NORMAL', 'PNEUMONIA'])
    plt.yticks(tick_marks, ['NORMAL', 'PNEUMONIA'])

    fmt = 'd'
    thresh = cm.max() / 2.
    for i, j in np.ndindex(cm.shape):
        plt.text(j, i, format(cm[i, j], fmt),
                 horizontalalignment="center",
                 color="white" if cm[i, j] > thresh else "black")

    plt.ylabel('True label')
    plt.xlabel('Predicted label')
    plt.tight_layout()
    plt.show()

evaluate_model_manual(model_basic, X_test_bal, Y_test_bal, "Básico")

"""![image.png](data:image/png;base64,)

El modelo tiene alta precisión tanto en las clases NORMAL como PNEUMONIA, con más errores en la clasificación de PNEUMONIA.

#MODELO OPTIMIZADO CON KERASTUNER

###Propósito de Utilizar Keras Tuner:
- **Optimización de Hiperparámetros:** Keras Tuner busca automáticamente los mejores valores de los hiperparámetros (número de filtros, tamaño del kernel, unidades de la capa densa, tasa de dropout, optimizador) para mejorar el rendimiento del modelo.
- Es decir, permite ajustar el modelo para maximizar la precisión y minimizar la pérdida, adaptándose mejor a los datos específicos del problema.


*Se siguen utilizando los mismos métodos para calcular las pérdidas, optimizar los parámetros y evaluar el rendimiento.

MODELO
"""

def build_model(hp):
    model = Sequential()
    model.add(Conv2D(
        filters=hp.Int('conv_1_filter', min_value=32, max_value=128, step=32),
        kernel_size=hp.Choice('conv_1_kernel', values=[3, 5]),
        activation='relu',
        input_shape=(150, 150, 1),
        padding='same'
    ))
    model.add(MaxPooling2D(pool_size=(2, 2)))
    model.add(Conv2D(
        filters=hp.Int('conv_2_filter', min_value=32, max_value=128, step=32),
        kernel_size=hp.Choice('conv_2_kernel', values=[3, 5]),
        activation='relu',
        padding='same'
    ))
    model.add(MaxPooling2D(pool_size=(2, 2)))

    model.add(Flatten())
    model.add(Dense(
        units=hp.Int('dense_units', min_value=64, max_value=256, step=64),
        activation='relu'
    ))
    model.add(Dropout(
        rate=hp.Float('dropout_rate', min_value=0.2, max_value=0.5, step=0.1)
    ))
    model.add(Dense(2, activation='softmax'))

    model.compile(
        optimizer=hp.Choice('optimizer', values=['adam', 'rmsprop']),
        loss='categorical_crossentropy',
        metrics=['accuracy']
    )

    return model

tuner = RandomSearch(
    build_model,
    objective='val_accuracy',
    max_trials=20,  # Aumentar el número de combinaciones de hiperparámetros a probar
    executions_per_trial=1,  # Número de veces que se ejecutará cada combinación de hiperparámetros
    directory='my_dir',
    project_name='intro_to_kt'
)

"""Esta configuración permite realizar una búsqueda sistemática de los mejores hiperparámetros para el modelo, maximizando la precisión en el conjunto de validación.

- ***RandomSearch:*** Realiza una búsqueda aleatoria de hiperparámetros.
- ***objective='val_accuracy':*** Optimiza la precisión de validación.
- ***max_trials=20:*** Prueba hasta 20 combinaciones de hiperparámetros.
- ***executions_per_trial=1:*** Ejecuta cada combinación una vez.
- ***directory='my_dir', project_name='intro_to_kt':*** Guarda los resultados en el directorio especificado.
"""

checkpoint = ModelCheckpoint('best_model_tuner.keras', monitor='val_accuracy', verbose=1, save_best_only=True, mode='max')
reduce_lr = ReduceLROnPlateau(monitor='val_loss', factor=0.2, patience=5, min_lr=0.00001)

"""Se guarda el mejor modelo encontrado y se ajusta dinámicamente la tasa de aprendizaje para optimizar el rendimiento."""

tuner.search(train_generator, epochs=10, validation_data=(X_val_bal, Y_val_bal))

"""Realiza una búsqueda sistemática de los mejores hiperparámetros para optimizar el rendimiento del modelo en términos de precisión de validación, entrenando cada configuración durante 10 épocas."""

best_hps = tuner.get_best_hyperparameters(num_trials=1)[0]
model_tuner = tuner.hypermodel.build(best_hps)

"""Se elecciona los mejores hiperparámetros encontrados y se construye el modelo optimizado con esos hiperparámetros."""

history_tuner = model_tuner.fit(
    train_generator,
    validation_data=(X_val_bal, Y_val_bal),
    epochs=30,
    callbacks=[ checkpoint, reduce_lr]
)

"""Se entrena el modelo optimizado utilizando los mejores hiperparámetros encontrados, con datos aumentados en tiempo real y se evalua el rendimiento en un conjunto de validación, mientras se utilizan callbacks para guardar el mejor modelo y ajustar dinámicamente la tasa de aprendizaje."""

test_loss_tuner, test_acc_tuner = model_tuner.evaluate(X_test_bal, Y_test_bal)
print(f'Precisión en el conjunto de prueba (modelo optimizado): {test_acc_tuner * 100:.2f}%')

acc_tuner = history_tuner.history['accuracy']
val_acc_tuner = history_tuner.history['val_accuracy']
loss_tuner = history_tuner.history['loss']
val_loss_tuner = history_tuner.history['val_loss']
epochs_tuner = range(len(acc_tuner))

plt.figure(figsize=(12, 6))
plt.subplot(1, 2, 1)
plt.plot(epochs_tuner, acc_tuner, '#FFD884', label='Precisión de Entrenamiento (Optimizado)')
plt.plot(epochs_tuner, val_acc_tuner, '#3CA4BE', label='Precisión de Validación (Optimizado)')
plt.title('Comparación de Precisión de Entrenamiento y Validación')
plt.legend()

plt.subplot(1, 2, 2)
plt.plot(epochs_tuner, loss_tuner, '#FFD884', label='Pérdida de Entrenamiento (Optimizado)')
plt.plot(epochs_tuner, val_loss_tuner, '#3CA4BE', label='Pérdida de Validación (Optimizado)')
plt.title('Comparación de Pérdida de Entrenamiento y Validación')
plt.legend()

